import React from 'react';
import { Link } from "react-router-dom";


export default function Pokemon ({id, name, image, types}){
    let type1 = types[0];
    let type2 = types[1];

    return(
        <div>
            <h4>    
                {id}
            </h4>
            <Link to={`/pokemon/${id}`}>
                <h3>
                    {name}
                </h3>
            </Link>
            <img src={image} alt={name}></img>
            <h5>
                {type1}
            </h5>
            <h5>
                {type2}
            </h5>
        </div>
    )
}
